import React from 'react';

const SuperHeaderTag = React.memo(function({index, class_name, on_click, label}){

    const onClickNew = on_click.bind(undefined, label);

    console.log(label);

    return <th key={index} className={class_name} onClick={onClickNew}>
        <div>{label}</div>
        <div></div>
    </th>
});

export default SuperHeaderTag;
